document.addEventListener("DOMContentLoaded", function () {
    // Product data
    const products = [
        { name: "iPhone 14 Pro", price: 999, rating: 4.5, img: "data:image/jpeg;base64,", category: "electronics" },
        { name: "Samsung Galaxy S23", price: 899, rating: 4.7, img: "data:image/jpeg;base64,", category: "electronics" },
        { name: "Nike Sneakers", price: 120, rating: 4.3, img: "data:image/jpeg;base64,", category: "fashion" },
        { name: "Men's Leather Jacket", price: 250, rating: 4.6, img: "data:image/jpeg;base64,", category: "fashion" },
        { name: "Air Fryer", price: 150, rating: 4.2, img: "data:image/jpeg;base64,", category: "home" },
        { name: "Couch Set", price: 1200, rating: 4.8, img: "data:image/jpeg;base64,", category: "home" },
        { name: "Treadmill", price: 600, rating: 4.1, img: "data:image/jpeg;base64,", category: "sports" },
        { name: "Yoga Mat", price: 40, rating: 4.0, img: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ1uTxCm2WbseoH29RwxvvCSt4OKrY7JsFbeA&s", category: "sports" }
    ];

    // Cart and modal elements
    let cart = [];
    const cartCount = document.getElementById("cart-count");
    const cartItemsContainer = document.getElementById("cart-items");
    const totalAmountDisplay = document.getElementById("total-amount");
    const sortSelect = document.getElementById("sort-select");
    const productList = document.getElementById("product-list");

    // Function to display product cards dynamically
    function displayProducts(category = "all", sortBy = "name") {
        productList.innerHTML = "";
        const filteredProducts = category === "all" ? products : products.filter(p => p.category === category);

        // Sort products
        filteredProducts.sort((a, b) => {
            if (sortBy === "name") return a.name.localeCompare(b.name);
            if (sortBy === "price") return a.price - b.price;
            if (sortBy === "rating") return b.rating - a.rating;
        });

        // Display product cards
        filteredProducts.forEach(product => {
            const productCard = `
                <div class="col-md-4 mb-4">
                    <div class="card shadow-lg border-light rounded overflow-hidden product-card">
                        <img src="${product.img}" class="card-img-top product-img" alt="${product.name}">
                        <div class="card-body">
                            <h5 class="card-title product-title">${product.name}</h5>
                            <p class="card-text text-muted">${product.rating} ⭐</p>
                            <p class="product-price">$${product.price}</p>
                            <button class="btn btn-primary btn-sm add-to-cart-btn" data-product-id="${product.name}">
                                <i class="fas fa-cart-plus"></i> Add to Cart
                            </button>
                        </div>
                    </div>
                </div>
            `;
            productList.innerHTML += productCard;
        });
    }

    // Handle category change
    const categoryItems = document.querySelectorAll('.list-group-item');
    categoryItems.forEach(item => {
        item.addEventListener('click', function () {
            document.querySelector('.list-group-item.active').classList.remove('active');
            this.classList.add('active');
            displayProducts(this.dataset.category, sortSelect.value);
        });
    });

    // Handle sorting change
    sortSelect.addEventListener("change", function () {
        displayProducts(document.querySelector('.list-group-item.active').dataset.category, this.value);
    });

    // Add to Cart functionality
    productList.addEventListener("click", function (e) {
        if (e.target && e.target.classList.contains("add-to-cart-btn")) {
            const productId = e.target.getAttribute("data-product-id");
            const product = products.find(p => p.name === productId);
            if (product) {
                cart.push(product);
                updateCartDisplay();
                alert(`${product.name} added to cart!`);
            }
        }
    });

    // Remove from Cart functionality
    function removeFromCart(productId) {
        cart = cart.filter(item => item.name !== productId);
        updateCartDisplay();
    }

    // Update cart count and display
    function updateCartDisplay() {
        cartCount.textContent = cart.length;
        displayCartItems();
    }

    // Display cart items in modal
    function displayCartItems() {
        cartItemsContainer.innerHTML = "";
        if (cart.length === 0) {
            cartItemsContainer.innerHTML = "<p class='text-center text-muted'>Your cart is empty.</p>";
        } else {
            cart.forEach(item => {
                const cartItem = `
                    <div class="cart-item d-flex justify-content-between align-items-center mb-3">
                        <p><strong>${item.name}</strong> - $${item.price}</p>
                        <button class="btn btn-danger btn-sm remove-from-cart-btn" data-product-id="${item.name}">
                            <i class="fas fa-trash"></i> Remove
                        </button>
                    </div>
                `;
                cartItemsContainer.innerHTML += cartItem;
            });

            // Add remove functionality
            const removeBtns = document.querySelectorAll(".remove-from-cart-btn");
            removeBtns.forEach(btn => {
                btn.addEventListener("click", function () {
                    const productId = btn.getAttribute("data-product-id");
                    removeFromCart(productId);
                });
            });
        }
        // Update the total amount
        updateTotalAmount();
    }

    // Calculate total cart amount
    function updateTotalAmount() {
        const totalAmount = cart.reduce((total, item) => total + item.price, 0);
        totalAmountDisplay.textContent = `$${totalAmount.toFixed(2)}`;
    }

    // Initial load of products
    displayProducts("all", "name");
});


// check out and close of card button
document.addEventListener("DOMContentLoaded", function () {
    const checkoutButton = document.getElementById("checkout-btn"); // Checkout button
    const closeButton = document.querySelector(".btn-close"); // Close button (cross)

    // Handle Checkout functionality
    checkoutButton.addEventListener("click", function () {
        if (cart.length === 0) {
            alert("Your cart is empty. Please add items to your cart before checking out.");
        } else {
            alert("Proceeding to checkout...");
            cart = []; // Clear the cart after checkout
            updateCartDisplay(); // Update cart count and items display
        }
    });

    // Ensure Close button closes the modal (optional, Bootstrap should handle this automatically)
    closeButton.addEventListener("click", function () {
        const cartModal = new bootstrap.Modal(document.getElementById("cart-modal"));
        cartModal.hide(); // Close the modal programmatically if necessary
    });
});


