// Fetch orders from the backend and populate the orders modal
async function fetchOrders() {
    try {
        const response = await fetch('http://localhost:5000/api/orders');
        if (!response.ok) throw new Error('Failed to fetch orders');

        const orders = await response.json();
        const ordersList = document.getElementById('orders-list');
        const noOrdersMessage = document.getElementById('noOrdersMessage');

        ordersList.innerHTML = ''; // Clear previous orders

        if (orders.length === 0) {
            noOrdersMessage.style.display = 'block';
        } else {
            noOrdersMessage.style.display = 'none';
            orders.forEach(order => {
                const orderItem = `
                        <div class="list-group-item d-flex justify-content-between align-items-center flex-wrap">
                            <div>
                                <h5 class="mb-1">Order #${order.orderId}</h5>
                                <p class="mb-1">${order.items.length} Items - Total: <strong>$${order.totalPrice.toFixed(2)}</strong></p>
                                <span class="badge bg-${order.status === 'Delivered' ? 'success' : 'warning'}">${order.status}</span>
                            </div>
                            <div>
                                <button class="btn btn-sm btn-primary view-order-details" data-order-id="${order.orderId}" data-bs-toggle="modal" data-bs-target="#orderDetailsModal">View Details</button>
                                <button class="btn btn-sm btn-secondary track-order" data-order-id="${order.orderId}">Track Order</button>
                            </div>
                        </div>
                    `;
                ordersList.innerHTML += orderItem;
            });
        }
    } catch (error) {
        console.error('Error fetching orders:', error);
        document.getElementById('orders-list').innerHTML = `<p class="text-danger text-center">Failed to load orders.</p>`;
    }
}

// Fetch order details when "View Details" button is clicked (Event Delegation)
document.addEventListener('click', async (e) => {
    if (e.target.classList.contains('view-order-details')) {
        const orderId = e.target.dataset.orderId;
        try {
            const response = await fetch(`http://localhost:5000/api/orders/${orderId}`);
            if (!response.ok) throw new Error('Failed to fetch order details');

            const order = await response.json();

            // Populate the Order Details Modal
            document.getElementById('orderId').textContent = order.orderId;
            document.getElementById('orderStatus').textContent = order.status;
            document.getElementById('orderItems').textContent = order.items.length;
            document.getElementById('orderTotal').textContent = `$${order.totalPrice.toFixed(2)}`;
            document.getElementById('shippingAddress').textContent = order.shippingAddress;
        } catch (error) {
            console.error('Error fetching order details:', error);
            alert('Failed to load order details.');
        }
    }
});

// Initialize fetch when the page loads
window.onload = fetchOrders;


//  Dark Mode JavaScript

    document.addEventListener("DOMContentLoaded", function () {
        const darkModeToggle = document.getElementById("darkModeToggle");
        const body = document.body;

        // Check if dark mode is already enabled in localStorage
        if (localStorage.getItem("darkMode") === "enabled") {
            body.classList.add("dark-mode");
            darkModeToggle.checked = true;
        }

        // Toggle Dark Mode
        darkModeToggle.addEventListener("change", function () {
            if (darkModeToggle.checked) {
                body.classList.add("dark-mode");
                localStorage.setItem("darkMode", "enabled");
            } else {
                body.classList.remove("dark-mode");
                localStorage.setItem("darkMode", "disabled");
            }
        });
    });

    // Dark Mode Styles
    const darkModeStyles = document.createElement("style");
    darkModeStyles.innerHTML = `
        .dark-mode {
            background-color: #121212 !important;
            color: white !important;
        }
        .dark-mode .modal-content {
            background-color: #1e1e1e;
            color: white;
        }
        .dark-mode .nav-pills .nav-link {
            background-color: #2c2c2c;
            color: white;
        }
        .dark-mode .nav-pills .nav-link.active {
            background-color: #007bff;
        }
        .dark-mode .form-control {
            background-color: #333;
            color: white;
            border: 1px solid #555;
        }
        .dark-mode .btn {
            background-color: #007bff;
            color: white;
        }
        .dark-mode .btn-danger {
            background-color: #dc3545;
        }
        .dark-mode .btn-success {
            background-color: #28a745;
        }
    `;
    document.head.appendChild(darkModeStyles);


//    JavaScript for Password Toggle 
    function togglePassword(id) {
        let input = document.getElementById(id);
        let icon = input.nextElementSibling.querySelector("i");

        if (input.type === "password") {
            input.type = "text";
            icon.classList.replace("fa-eye", "fa-eye-slash");
        } else {
            input.type = "password";
            icon.classList.replace("fa-eye-slash", "fa-eye");
        }
    }

